import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: '<div class="col-xs-8 col-xs-offset-2"></div> '
  //styleUrls: ['./app.component.css']
})
export class AppComponent {
  name = 'WebForMyself';
  pl = Math.PI;
  money = 350;
  date = new Date();
  amount = 0.45;
  object = {
    foo: 'bar';
    buz: 'qux'
  }

  onClick(number: number) {
    this.current = number
  }
}
